import './App.css';

function App() {
  return (
    <div>
     <Navbar />
      <Routes >
        <Route path="/" element={<Home />} />

        <Route  path ="/About" element={<About />}/>

        <Route  path ="/Contact" element={<Contact />}/>

        <Route  path ="/homes" element={<Homes />}/>

        <Route  path ="/vendor" element={<Vendor />}/>  

        <Route  path ="/user" element={<User />}/> 

      </Routes>
    </div>
  );
}

export default App;
